    {
        title: "Home",
        path: "/",
        icon: <AiOutlineHome/>,
        cName: "nav-Text",
    },{
        title: "Transactions",
        path: "/transactions",
        icon:<GrTransaction/>,
        cName: "nav-Text",
    }
]

export default NavbarData;
